//Script đổi tường 1 thành sàn 0

function cleanUpExteriorWalls(inputMap) {
    const MAP_HEIGHT = inputMap.length;
    if (MAP_HEIGHT === 0) return [];
    const MAP_WIDTH = inputMap[0].length;
    if (MAP_WIDTH === 0) return [];

    // Tạo một bản sao của map để chỉnh sửa
    let newMap = JSON.parse(JSON.stringify(inputMap));

    // Tạo một map đánh dấu các ô đã được duyệt hoặc là phần của "đất liền"
    let visited = Array(MAP_HEIGHT).fill(false).map(() => Array(MAP_WIDTH).fill(false));

    // Hàm kiểm tra xem tọa độ có hợp lệ không
    function isValid(r, c) {
        return r >= 0 && r < MAP_HEIGHT && c >= 0 && c < MAP_WIDTH;
    }

    // Hàm Flood Fill (hoặc BFS) để tìm tất cả các ô sàn và tường bao quanh chúng
    function floodFill(r, c) {
        let queue = [[r, c]];
        visited[r][c] = true;

        while (queue.length > 0) {
            let [currR, currC] = queue.shift();

            // Duyệt 8 ô xung quanh (và chính nó) để tìm tường bao
            for (let dr = -1; dr <= 1; dr++) {
                for (let dc = -1; dc <= 1; dc++) {
                    let nr = currR + dr;
                    let nc = currC + dc;

                    if (isValid(nr, nc) && !visited[nr][nc]) {
                        if (inputMap[nr][nc] !== 0) { // Nếu là tường (1, 2, 3, 9...)
                            visited[nr][nc] = true; // Đánh dấu là tường quan trọng
                        } else { // Nếu là sàn (0, 4, 5, 6, 7, 8)
                            visited[nr][nc] = true;
                            queue.push([nr, nc]);
                        }
                    }
                }
            }
        }
    }

    // Tìm một ô sàn bất kỳ để bắt đầu Flood Fill
    // Ưu tiên tìm điểm spawn (8) hoặc các ô sàn (0)
    let startFloodFillFound = false;
    for (let r = 0; r < MAP_HEIGHT; r++) {
        for (let c = 0; c < MAP_WIDTH; c++) {
            if (inputMap[r][c] === 8 || inputMap[r][c] === 0 || inputMap[r][c] === 4 || inputMap[r][c] === 5 || inputMap[r][c] === 6 || inputMap[r][c] === 7) {
                floodFill(r, c);
                startFloodFillFound = true;
                break; 
            }
        }
        if (startFloodFillFound) break;
    }
    
    if (!startFloodFillFound) {
        console.warn("Không tìm thấy ô sàn nào để bắt đầu dọn dẹp. Map có thể toàn tường.");
        return newMap; // Trả về map gốc nếu không có sàn
    }


    // Chuyển tất cả các ô tường không được "visited" thành sàn
    for (let r = 0; r < MAP_HEIGHT; r++) {
        for (let c = 0; c < MAP_WIDTH; c++) {
            if (inputMap[r][c] === 1 && !visited[r][c]) { // Chỉ xử lý tường gốc (1)
                newMap[r][c] = 0; // Chuyển thành sàn
            }
        }
    }

    return newMap;
}

